import React from "react";
import css from "./style.module.css";

const BurgerIngredient = (props) => {
  if (props.type === "salad") return <div className={css.Salad}></div>;
  else if (props.type === "cheese")
    return <div className={css.cheese}>{props.type}</div>;
  else if (props.type === "bread-top")
    return <div className={css.breadTop}>{props.type}</div>;
  else if (props.type === "becon")
    return <div className={css.becon}>{props.type}</div>;
  return <div>{props.type}</div>;
};

export default BurgerIngredient;
